function ajaxPoziv(){$('a[ajaxpoziv="da" ]').click(function(){var n=$(this).attr("ajaxurl"),t=$(this).attr("ajaxrezultat");$.get(n,function(n){$("#"+t).html(n)})})}function ajaxForma(){$('form[ajaxpoziv="da" ]').submit(function(n){var r=$(this),t,i;n.preventDefault();t=$(this).attr("ajaxurl");i=$(this).attr("ajaxrezultat");$.ajax({type:"POST",url:t,data:r.serialize(),success:function(n){$("#"+i).html(n)}})})}$(document).ready(function(){var n=$('[ajaxOnLoad="da"]'),t=n.attr("ajaxUrl"),i=n.attr("ajaxRezultat");$.get(t,function(n){$("#"+i).html(n)})});$(document).ajaxComplete(function(){ajaxPoziv();ajaxForma()});